import "./components.css";

class Result extends React.Component {
    constructor(props){
        super(props);
    }

    render(){
      return(
        <div className="all-wrapper">
            <div className="result-wrapper">
                {this.props.results.map((element, i) => 
                    <table>
                        <tr>
                            <td>{i+1}</td>
                            <td>{element}</td>
                        </tr>
                    </table>
                )}
            </div>
        </div>
      )
    }
}  
export default Result;
